property.value:
-- init
button_value = {}                             

list = self:findAllByType(ControlType.BUTTON)   -- create list of buttons in Group

for i = 1, #list do                             -- init list of button values
  button_value[i] = 0     
end      

old_button = 0
on = {}
super = {}
off = {}

-- 'on' messages.
on["any"] = {}  
on[1] = {{ MIDIMessageType.CONTROLCHANGE, 1, 127 }, {true, true}}
on[2] = {{ MIDIMessageType.CONTROLCHANGE, 2, 127 }, {true, false}}
on[3] = {{ MIDIMessageType.CONTROLCHANGE, 3, 127 }}
on[4] = {{ MIDIMessageType.CONTROLCHANGE, 4, 127 }, {true, true}}
on[5] = {{ MIDIMessageType.CONTROLCHANGE, 5, 127 }}
on[6] = {{ MIDIMessageType.CONTROLCHANGE, 6, 127 }, {true, false}}
on[7] = {{ MIDIMessageType.CONTROLCHANGE, 7, 127 }}
on[8] = {{ MIDIMessageType.CONTROLCHANGE, 8, 127 }, {true, true}}

-- 'super' messages.
super[0] = {} 
super[1] = {{ MIDIMessageType.CONTROLCHANGE, 1, 63 }, {true, true}}
super[2] = {{ MIDIMessageType.CONTROLCHANGE, 2, 63 }, {true, false}}
super[3] = {{ MIDIMessageType.CONTROLCHANGE, 3, 63 }}
super[4] = {{ MIDIMessageType.CONTROLCHANGE, 4, 63 }, {true, true}}
super[5] = {{ MIDIMessageType.CONTROLCHANGE, 5, 63 }}
super[6] = {{ MIDIMessageType.CONTROLCHANGE, 6, 63 }, {true, false}}
super[7] = {{ MIDIMessageType.CONTROLCHANGE, 7, 63 }}
super[8] = {{ MIDIMessageType.CONTROLCHANGE, 8, 63 }, {true, true}}

-- 'off' messages.
off["any"] = {} 
off[1] = {{ MIDIMessageType.CONTROLCHANGE, 1, 0 }, {true, true}}
off[2] = {{ MIDIMessageType.CONTROLCHANGE, 2, 0 }, {true, false}}
off[3] = {{ MIDIMessageType.CONTROLCHANGE, 3, 0 }}
off[4] = {{ MIDIMessageType.CONTROLCHANGE, 4, 0 }, {true, true}}
off[5] = {{ MIDIMessageType.CONTROLCHANGE, 5, 0 }}
off[6] = {{ MIDIMessageType.CONTROLCHANGE, 6, 0 }, {true, false}}
off[7] = {{ MIDIMessageType.CONTROLCHANGE, 7, 0 }}
off[8] = {{ MIDIMessageType.CONTROLCHANGE, 8, 0 }, {true, true}}

function update()
  for i = 1, #list do                     
    if list[i].values.x ~= button_value[i] then
      if list[i].values.x > 0 then
        switch("ON", i)
      else
        switch("OFF", i)
      end
      button_value[i] = list[i].values.x
    end
  end
end

function switch(command, button)
  if old_button ~= 0 and old_button ~= button then
    self.children[tostring(old_button)].values.x = 0
    button_value[old_button] = 0
  end

  if command == "ON" then
    handle_button(super[tonumber(old_button)])
    old_button = button
    handle_button(on["any"])
    handle_button(on[tonumber(button)])
  elseif command == "OFF" then
    handle_button(off["any"])
    handle_button(off[tonumber(button)])
    old_button = 0
  end
end

function handle_button(midi_msg)
  if #midi_msg == 0 then
    return
  else
    sendMIDI(unpack(midi_msg))
  end
end

