function switch(command, button)
  if old_button ~= 0 and old_button ~= button then
    self.children[tostring(old_button)].values.x = 0
    button_value[old_button] = 0
  end

  if command == "ON" then
    handle_button(super[tonumber(old_button)])
    old_button = button
    handle_button(on["any"])
    handle_button(on[tonumber(button)])
  elseif command == "OFF" then
    -- Prevent the button from toggling itself off
    self.children[tostring(button)].values.x = 1
    button_value[button] = 1
  end
end

