-- init button_value = {}
list = self:findAllByType(ControlType.BUTTON) -- create list of buttons in Group
for i = 1, #list do -- init list of button values button_value[i] = 0 end
old_button = 0 on = {} super = {} off = {}
-- 'on' messages. on["any"] = {} on[1] = {{ MIDIMessageType.CONTROLCHANGE, 1, 127 }, {true, true}} on[2] = {{ MIDIMessageType.CONTROLCHANGE, 2, 127 }, {true, false}}
-- 'super' messages. super[0] = {} super[1] = {{ MIDIMessageType.CONTROLCHANGE, 1, 63 }, {true, true}} super[2] = {{ MIDIMessageType.CONTROLCHANGE, 2, 63 }, {true, false}}
-- 'off' messages. off["any"] = {} off[1] = {{ MIDIMessageType.CONTROLCHANGE, 1, 0 }, {true, true}} off[2] = {{ MIDIMessageType.CONTROLCHANGE, 2, 0 }, {true, false}}
function update() for i = 1, #list do if list[i].values.x ~= button_value[i] then if list[i].values.x > 0 then switch("ON", i) else switch("OFF", i) end button_value[i] = list[i].values.x end end end
function switch(command, button) if old_button ~= 0 and old_button ~= button then self.children[tostring(old_button)].values.x = 0 button_value[old_button] = 0 end
if command == "ON" then handle_button(super[tonumber(old_button)]) old_button = button handle_button(on["any"]) handle_button(on[tonumber(button)]) elseif command == "OFF" then handle_button(off["any"]) handle_button(off[tonumber(button)]) old_button = 0 end end
function handle_button(midi_msg) if #midi_msg == 0 then return else sendMIDI(unpack(midi_msg)) end end

----- messages to be sent ------------------------------
-- init button_value = {}
list = self:findAllByType(ControlType.BUTTON) -- create list of buttons in Group
for i = 1, #list do -- init list of button values button_value[i] = 0 end
old_button = 0 on = {} super = {} off = {}
-- 'on' messages.
-- Sent by ANY button that is pushed and turned on: on["any"] = {}
-- 'on' messages for individual buttons (starting at 1): on[1] = {{ MIDIMessageType.CONTROLCHANGE, 1, 127 }, {true, true}} on[2] = {{ MIDIMessageType.CONTROLCHANGE, 2, 127 }, {true, false}} on[3] = {{ MIDIMessageType.CONTROLCHANGE, 3, 127 }} on[4] = {{ MIDIMessageType.CONTROLCHANGE, 4, 127 }, {true, true}}
-- 'super' messages. -- Sent by button that gets superseded by another one
-- in case there is no previously active button (all buttons off): super[0] = {}
-- 'super' messages for individual buttons (starting at 1): super[1] = {{ MIDIMessageType.CONTROLCHANGE, 1, 63 }, {true, true}} super[2] = {{ MIDIMessageType.CONTROLCHANGE, 2, 63 }, {true, false}} super[3] = {{ MIDIMessageType.CONTROLCHANGE, 3, 63 }} super[4] = {{ MIDIMessageType.CONTROLCHANGE, 4, 63 }, {true, true}}
-- 'off' messages. -- Sent when the only active button is pushed and turned off, not on button change
-- message sent at ANY 'off' event off["any"] = {}
-- 'off' messages for individual buttons (for Grid starting at 1) off[1] = {{ MIDIMessageType.CONTROLCHANGE, 1, 0 }, {true, true}} off[2] = {{ MIDIMessageType.CONTROLCHANGE, 2, 0 }, {true, false}} off[3] = {{ MIDIMessageType.CONTROLCHANGE, 3, 0 }} off[4] = {{ MIDIMessageType.CONTROLCHANGE, 4, 0 }, {true, true}}
-- examples: -- on[1] = {} -- send no message -- on[2] = {{ MIDIMessageType.CONTROLCHANGE, 13, 127 }} -- send ctrl change to all outputs -- on[3] = {{ MIDIMessageType.CONTROLCHANGE, 13, 127 }, {false, true}} -- send ctrl change to selected outputs
-- more info on sending MIDI: -- https://hexler.net/touchosc/manual/script-examples#sending-midi-messages -- https://hexler.net/touchosc/manual/script-enumerations#midimessagetype
--------------------------------------------------------
function update()
for i = 1, #list do
if list[i].values.x ~= button_value[i] then -- check if value of button 'i' has changed
if list[i].values.x > 0 then -- check if button 'i' was switched on or off switch("ON", i) else switch("OFF", i) end
button_value[i] = list[i].values.x -- update button value in list
end end end
function switch(command, button)
if old_button ~= 0 then -- if other button is active then turn it off self.children[tostring(old_button)].values.x = 0 button_value[old_button] = 0 -- update value of old button in list end
if command == "ON" then -- if a button was turned 'on'
handle_button(super[tonumber(old_button)]) -- handle individual 'super' msg of button that gets superseded old_button = button -- save the now active button for next 'super' action
handle_button(on["any"]) -- handle the generic 'on' msg handle_button(on[tonumber(button)]) -- handle the individual 'on' msg
elseif command == "OFF" then -- if a button was turned 'off'
handle_button(off["any"]) -- handle the generic 'off' msg handle_button(off[tonumber(button)]) -- handle the individual 'off' msg old_button = 0 -- set now active button to 'none'
end
end
function handle_button(midi_msg)
if #midi_msg == 0 then -- if no MIDI message is set: do nothing return else -- if MIDI message is set: unpack and send sendMIDI(unpack(midi_msg)) end
end
